import { useEffect, useState, forwardRef, useImperativeHandle } from "react";
import Button from '@mui/material//Button';
import Landing from './Landing.js';
import Table from './Table.js';
import { Link, browserRouter, Route, Routes } from 'react-router-dom'

function Home({ onLogout }) {
    const [token, setToken] = useState("")
    const [url, setURL] = useState("")
    const logout = () => {
        setToken("")
        window.localStorage.removeItem("token")
        window.location.reload();
    }
    return (
        <div className='Home'>
            <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>
            <div className='navBar'>
                <p className='navBarItem'>TrackTheSpot</p>
                <div className='navBarItem'>
                    <Link to='/'><p className='navBarItemMenu'>Home</p></Link>
                    <Link to='/about'><p className='navBarItemMenu'>About</p></Link>
                    <Link to='/'><div onClick={logout}><p className='navBarItemMenu'>Logout</p></div></Link>
                </div>

            </div>
        </div>
    );
}

export default Home;
